const Weird=(props)=>{
    return (
        <>
          <hr/>
          <h2>My Profile</h2>
          <ol>
             
              <li>Dog Name:{props.name}</li>
              <li>Favorite Food:{props.food}</li>
              <li>Drinks:{props.drinks}</li>
          </ol>
        </>
       
      );
}
export default Weird;
